import { css } from '@emotion/react';

export const container = css`
  .blue{
    color: #4063EC;
  }
  .MuiTypography-root{
    font-weight: 800;
  }
  .content{
    max-width: 1260px;
    width: 100%;
    margin: 0 auto;
    padding: 80px 0px;
  }
`;
